const Button = ({ text, type }) => {
  let HtmlButton = (
    <button
      className={
        `bg-primary py-2 px-5 rounded-2xl text-white text-xl duration-100 hover:shadow w-32 ` +
        (type === 1 ? `` : ``)
      }
    >
      {text}
    </button>
  );
  return HtmlButton;
};

export default Button;
